actionConfiguration.body:
() => {
		let activeAssociates = getAllActivesAssociates.data
		let total = activeAssociates.length
		let bb = activeAssociates.filter((a) => a.bank == "BB").length
		let cef = activeAssociates.filter((a) => a.bank == "CEF").length
		let bradesco = activeAssociates.filter((a) => a.bank == "BRADESCO").length
		let itau = activeAssociates.filter((a) => a.bank == "ITAU").length
		let santander = activeAssociates.filter((a) => a.bank == "SANTANDER").length
		let bnb = activeAssociates.filter((a) => a.bank == "BNB").length
		return [
			{
				x: "BB",
				y: bb / total * 100
			},
			{
				x: "CEF",
				y: 100 - bb / total * 100
			},
			{
				x: "BRADESCO",
				y: 0
			},
			{
				x: "ITAU",
				y: 0
			},
			{
				x: "SANTANDER",
				y: 0
			},
			{
				x: "BNB",
				y: 0
			},
		]

	}

